#include <iostream>
#include <string>

void printDiamond(int size) {
    if (size % 2 == 0) {
        std::cout << "Size must be odd for a symmetric diamond!\n";
        return;
    }

    int spaces = size / 2;
    int stars = 1;

    // Upper half of the diamond
    for (int i = 0; i < size / 2 + 1; ++i) {
        std::cout << std::string(spaces, ' ') << std::string(stars, '*') << '\n';
        spaces--;
        stars += 2;
    }

    // Lower half of the diamond
    spaces = 1;
    stars = size - 2;
    for (int i = 0; i < size / 2; ++i) {
        std::cout << std::string(spaces, ' ') << std::string(stars, '*') << '\n';
        spaces++;
        stars -= 2;
    }
}

int main() {
    int size;
    std::cout << "Enter an odd number for diamond size: ";
    std::cin >> size;

    printDiamond(size);

    return 0;
}
